import React from "react";
import "./Experience.scss";

export default function Experience() {
  const data = [
    {
      id: 1,
      name: "ZF Groups",
      year: "2022 - Present",
      title: "SIL Engineer",
      role: "Software-in-the-Loop (SIL) Integration and Testing",
      tools: "SIL System Integration, C++ , QT , Python and Linux",
      icon: "assets/Logo-1.png",
      featured: true,
    },
  ];

  return (
    <div className="Experience" id="Experience">
      <h1>Experience</h1>
      <div className="container">
        {data.map((d) => (
          <div key={d.id} className={d.featured ? "card featured" : "card"}>
            <div className="top">
              <img
                className="icon"
                src={d.icon}
                alt={`${d.name} logo`}
              />
            </div>
            <div className="content">
              <h4 className="title">{d.title}</h4>
              <h3 className="name">{d.name}</h3>
              <p className="year">{d.year}</p>
              <p className="role">{d.role}</p>
              <p className="tools">{d.tools}</p>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
}
